import React from "react";
import {Link} from 'react-router-dom';

// react-bootstrap components
import {
  Badge,
  Button,
  Card,
  Form,
  Navbar,
  Nav,
  Container,
  Row,
  Col,
} from "react-bootstrap";

function User() {
  return (
    <>
      <Link to="/Userreg"> <Button variant="primary" size="lg" > 
    <i class="fa fa-plus" aria-hidden="true"></i>
     </Button> </Link>
     
    </>
  );
}

export default User;
